import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Home.css';
import burakImage from '../assets/burak-profile.webp';
import Logos from '../logo/Logo';
import backgroundVideo from '../assets/12121108_3840_2160_30fps.mp4';
import register from '../assets/austin-distel-744oGeqpxPQ-unsplash.webp';
import login from '../assets/desola-lanre-ologun-zYgV-NGZtlA-unsplash.webp';
import homepage from '../assets/undraw_fingerprint-login_19qv.webp';


function Home () {
  return (
    <div className="homeContainer">
      <video autoPlay loop muted className="backgroundVideo" playsInline preload="auto">
        <source src={backgroundVideo} type="video/mp4" />
        Tarayıcınız video etiketini desteklemiyor.
      </video>

      <div className='homeMainDiv'>
        <div className='homeFirstDiv'>
          <div className="photograph">
            <img src={burakImage} className="burakImage" alt="Burak Gündoğan" loading="lazy" />
          </div>
          <div className="nameSurname">Burak Gündoğan</div>
          <div className="title">Jr.Frontend/Full-Stack/Backend Developer</div>
          <div className="socialMedias">
            Sosyal Medya Hesaplarım ve Github Hesabım
            <div className='Icons'><Logos /></div>
          </div>
          <div className="copyright">Copyright © 2025 - Tüm Hakları Saklıdır.</div>
        </div>

        <div className='homeSecondDiv'>
          <p className="blog">BLOG SAYFAM</p>
          <p className='routerToHomePage' style={{ backgroundImage: `url(${homepage})` }}>Anasayfaya devam etmek için&nbsp;<Link to="/homepage"> <strong className='routerToHomePageStrong'>tıklayınız !</strong></Link></p>
          <p className='routerToLoginPage' style={{ backgroundImage: `url(${register})` }}>Kayıt olmak için&nbsp;<Link to="/register"> <strong className='routerToHomeLoginStrong'>tıklayınız !</strong></Link></p>
          <p className='routerToRegisterPage' style={{ backgroundImage: `url(${login})` }}>Giriş yapmak için&nbsp;<Link to="/login"> <strong className='routerToHomeRegisterStrong'>tıklayınız !</strong></Link></p>
        </div>
      </div>
    </div>
  );
}

export default Home;
